import React, { Component } from 'react';

class Projects extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh","backgroundColor":"#33466b"}}>
        <div class="uk-column-1-2" uk-grid uk-scrollspy="cls: uk-animation-fade; target: > div > .uk-card; delay: 500; repeat: true">
          <div>
              <div style={{"text-align":"center","position":"relative"}} class="uk-card uk-card-default uk-card-body">
                  <div style={{"position":"absolute","width":"300px","height":"300px","backgroundColor":"blue", "marginLeft":"100px"}}></div>
                  <img style={{"marginLeft":"50px","marginTop":"50px"}} src="pictures/me.jpg" width="50%" height="50%" alt="" uk-img/>
              </div>
          </div>
          <div>
              <div class="uk-card uk-card-default uk-card-body">
                  <h3 class="uk-card-title">Brian Yu</h3>
                  <p>Design</p>
                  <p>Architecture</p>
                  <p>Code</p>

              </div>
          </div>
        </div>

      </div>
    );
  }
}

export default Projects;
